import React from 'react';
import { connect } from 'redux-bundler-react';
class Home extends React.Component {
  render(){

    const { doAuthLogin, authIsLoggedIn, authUsername} = this.props;
    return (
      <div className="container">
        <div className="card bg-light m-5">
          <div className="card-body">
            <h2>Welcome to Share map</h2>
            <p>{ authUsername }</p>
            <button onClick={ doAuthLogin } className="btn btn-primary">Login</button>
          </div>
        </div>
      </div>
    )
  }
}

export default connect(
  'doAuthLogin',
  'selectAuthIsLoggedIn',
  'selectAuthUsername',
  Home
  );
